 ('1', '1', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 06:35:15', '2017-11-17 06:35:15', 'd6ba7a5b-f54f-401e-9625-fa8821a8909e'),
 ('2', '2', 'en_us', 'Homepage', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, 'It’s time to turn doubt into drive.', 'View Workouts', '', 'About', 'Robbie Birdwell', '“As Iron Sharpens Iron, So One Man Sharpens Another.”', 'Proverbs 27:17', '<h5>For Robbie Birdwell, fitness is more than a passion—it’s a lifestyle. He’s personally experienced the power of physical conditioning to provide mental, spiritual, and bodily healing. </h5>\n<p>Having a diverse background in health and fitness, Robbie specializes in injury prevention, rehabilitation, and functional training. His expertise in correcting mobility issues and faulty movement patterns has helped clients of all types, from injury-plagued couch potatoes to Division 1 college athletes.</p>\n<p>As a certified athletic trainer (through the National Board of Certification for Athletic Training), Robbie earned his bachelor’s degree in athletic training and sports medicine from Baylor University. He went on to receive a master’s degree in kinesiology from the University of North Texas. He worked with several notable athletes throughout his collegiate career including track stars, Jeremy Wariner, Darold Williamson, and Stephen White as well as then up-and-coming NFL players, Robert Griffin III (RG3), Jason Smith, Lance Dunbar, and Zachary Orr.</p>\n<p>Robbie also knows firsthand what it takes to prepare and compete. He played professional arena football in the Indoor Football League (IFL) for two years and competed as a bodybuilder within the physique division for the Better Bodies Championship. </p>\n<p>Robbie’s extensive education and experience have prepared him to offer quality service and care. His goal-oriented approach and customized, research-based workout programs empower clients to be accountable, stay motivated, and have fun!</p>\n<p>When Robbie is not at the gym, he enjoys riding his motorcycle, playing the guitar, and watching football (no surprise!).</p>', NULL, NULL, NULL, 'Services', '<h5>Working out, eating healthy, and losing weight does not have to be a chore. </h5>\n<p>It should be an energizing, enjoyable, and empowering experience that you look forward to every day. Together, we will overcome your obstacles, push your boundaries and have a ton of fun, making your fitness dreams a reality.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'What my clients are saying...', NULL, NULL, NULL, NULL, '5555 E. Mockingbird Lane S-200\r\nDallas, Texas 75206', '254.214.2618', 'bodybyrobbie@gmail.com', '2017-11-17 06:35:17', '2017-12-13 13:03:26', '2aba6aaf-0d2e-4446-8c00-ee14abed3d05'),
 ('3', '3', 'en_us', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Localhost. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p><!--pagebreak--><p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p><p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 06:35:17', '2017-11-17 06:35:17', 'dcace178-b56a-45d8-b454-f05801c73385'),
 ('4', '4', 'en_us', 'Bbr Hero', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 07:59:01', '2017-11-17 07:59:01', 'bbca6f16-8363-4983-a258-cfdb84c3d465'),
 ('5', '5', 'en_us', 'Robbie Circle', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-11-17 08:02:07', '2017-11-17 08:02:07', 'b7669c9d-06af-4fd9-b21b-0aea73bf5e7c'),
 ('6', '6', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 06:22:01', '2017-12-09 14:32:16', '964a3432-0545-4d45-afb2-67e3248ce727'),
 ('7', '7', 'en_us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 06:38:13', '2017-12-03 06:38:13', 'ccea4637-2f77-4b9f-9728-4e5e61b911b9'),
 ('8', '8', 'en_us', 'What my clients are saying...', NULL, NULL, NULL, '“Robbie challenges me in ways better than any gym I have ever belonged to. He is friendly, professional and so much fun to be around. I tell whoever will listen—Robbie’s your guy.”', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Jennifer S.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 13:56:07', '2017-12-03 13:56:07', '3470b6b8-91f6-4330-8192-c0e9f561ab6b'),
 ('9', '9', 'en_us', 'Nutrition Coaching', '<p>Education is key when it comes to proper nutrition. That’s why I offer a separate service devoted to meal planning. Your dietary restrictions and workout goals should work together. Learn specific techniques to make meal prepping easier. Discover how to enjoy “cheat days” and still reach your fitness goals. Meal prepping and delivery are available through our partner, Prepped and Ready Meal Prep.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:02:54', '2017-12-03 14:02:54', '244c059a-e452-4ac8-8401-22c0f5a94cd8'),
 ('10', '10', 'en_us', '​Personal training', '<p>Intimidated by large groups? My personal training program is a great option for those who desire one-on-one attention. Together, we’ll assess your current state and establish realistic goals by completing a fitness and nutrition assessment. Using this data, I’ll develop a customized, guided workout program and nutrition plan. (Meal prepping and delivery available upon request.)</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:03:19', '2017-12-03 14:03:19', '1813c6af-92ae-471e-84dd-ef9c739a613d'),
 ('11', '11', 'en_us', 'Small Group Training', '<p>Thrive in small groups? Grab a group of 2-5 friends, relatives, or colleagues, and share the cost! We’ll use the fitness and nutrition assessment to create individual goals as well as to develop customized, guided workout programs and nutrition plans. You’ll still enjoy the benefit of personalized attention but in a slightly more social environment. (Meal prepping and delivery available upon request.)</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:03:48', '2017-12-03 14:03:48', 'c5843896-335e-404a-8005-8f932fa3bd4e'),
 ('12', '12', 'en_us', '​online training', '<p>Adapt your fitness program to your lifestyle with online training. If you travel often for work or prefer the comfort of your own home, I provide a customized experience, suitable for any setting, via the app, Trainerize. View your workouts, track your meals, send me messages, and more—access everything you need on your mobile device or desktop. (Meal prepping and delivery available upon request.)</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:04:07', '2017-12-03 14:04:07', 'c1f57db7-a951-4836-838c-b415f22e4ccb'),
 ('13', '13', 'en_us', '​bridal boot camps', '<p>Got the perfect dress, now need to fit into it? You’re not alone. Our bridal boot camps provide the perfect environment to whip your body into shape and de-stress at the same time. Bring your bridesmaids along—discounts are available for groups, so the more the merrier. Join now and get ready for the big day!</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:04:27', '2017-12-03 14:04:27', '67bb16c7-f596-4913-a69d-7211b6c6b330'),
 ('14', '14', 'en_us', '​sport-specific strength training', '<p>Want to take your athletic ability to the next level? Want to train like the pros? This program is for the serious athlete who needs help with distinct skills in order to compete. Drawing on my background as an athlete and athletic trainer, I provide rigorous workouts tailored to your sport as well as insight on the best techniques to help you reach your goals.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:04:56', '2017-12-03 14:04:56', 'cb1fcc4e-488b-4c47-a498-647996a85993'),
 ('15', '15', 'en_us', 'Workplace Ergonomics Consulting', '<p>Optimize your work space! Are you sitting correctly? Is your monitor in the best position? I’ll observe your work environment as well as how you work, and get an inventory of current physical issues (ex. headaches, backaches, etc.). From there, I’ll provide research-based solutions to modify your work space and enhance your wellness. Gain insight on the best ways to stay highly productive and injury-free.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:05:21', '2017-12-03 14:05:21', 'aef683b6-1253-4463-9133-64a7ed0aa08b'),
 ('16', '16', 'en_us', '​restorative therapy', '<p>Aches and pains? Come see me! My unique regimen of deep tissue massages and corrective exercises reduces the discomfort associated with many injuries. I employ the same level of care I used when working with both professional and division I athletes. Sign up for a free consultation, and we’ll discuss the best way to restore proper function to your body.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-03 14:05:38', '2017-12-03 14:05:38', '1ed14afc-0dde-4183-98eb-df0e02f6dd21'),
 ('18', '18', 'en_us', 'Logo', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-12-04 13:06:57', '2017-12-09 14:18:24', 'b5ed2390-e219-4717-b40c-6efe2c9659fd'),
