 ('1', '2', '1', '1', 'en_us', '1', NULL, '{\"typeId\":\"1\",\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1510900517,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2017-11-17 06:35:17', '2017-11-17 06:35:17', 'ae526874-8556-41f3-95e5-42d85329a668'),
 ('2', '2', '1', '1', 'en_us', '2', NULL, '{\"typeId\":null,\"authorId\":null,\"title\":\"Welcome to Localhost!\",\"slug\":\"homepage\",\"postDate\":1510900517,\"expiryDate\":null,\"enabled\":\"1\",\"parentId\":null,\"fields\":{\"1\":\"<p>It\\u2019s true, this site doesn\\u2019t have a whole lot of content yet, but don\\u2019t worry. Our web developers have just installed the CMS, and they\\u2019re setting things up for the content editors this very moment. Soon Localhost will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.<\\/p>\"}}', '2017-11-17 06:35:17', '2017-11-17 06:35:17', 'fa7cd5e0-733b-4c37-a9ab-62591694a493'),
 ('3', '3', '2', '1', 'en_us', '1', NULL, '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"We just installed Craft!\",\"slug\":\"we-just-installed-craft\",\"postDate\":1510900517,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":[]}', '2017-11-17 06:35:17', '2017-11-17 06:35:17', 'de71a7cd-6c58-4256-9644-4f03e2000a98'),
 ('4', '2', '1', '1', 'en_us', '3', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1510900517,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"\",\"13\":\"\",\"12\":\"\",\"14\":\"\",\"15\":\"\",\"11\":\"\",\"10\":[\"4\"],\"9\":\"\",\"8\":\"View Workouts\",\"7\":\"It\\u2019s time to turn doubt into drive.\",\"22\":\"\",\"23\":\"\",\"21\":\"\",\"18\":\"\"}}', '2017-11-17 07:59:06', '2017-11-17 07:59:06', '69860522-c74e-4a0f-9692-044ab13a4333'),
 ('5', '2', '1', '1', 'en_us', '4', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1510900517,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"<p>For Robbie Birdwell, fitness is more than a passion&mdash;it\\u2019s a lifestyle. He\\u2019s personally experienced the power of physical conditioning to provide mental, spiritual, and bodily healing.&nbsp;<\\/p>\\r\\n<p>Having a diverse background in health and fitness, Robbie specializes in injury prevention, rehabilitation, and functional training. His expertise in correcting mobility issues and faulty movement patterns has helped clients of all types, from injury-plagued couch potatoes to Division 1 college athletes.<\\/p>\\r\\n<p>As a certified athletic trainer (through the National Board of Certification for Athletic Training), Robbie earned his bachelor\\u2019s degree in athletic training and sports medicine from Baylor University. He went on to receive a master\\u2019s degree in kinesiology from the University of North Texas. He worked with several notable athletes throughout his collegiate career including track stars, Jeremy Wariner, Darold Williamson, and Stephen White as well as then up-and-coming NFL players, Robert Griffin III (RG3), Jason Smith, Lance Dunbar, and Zachary Orr.<\\/p>\\r\\n<p>Robbie also knows firsthand what it takes to prepare and compete. He played professional arena football in the Indoor Football League (IFL) for two years and competed as a bodybuilder within the physique division for the Better Bodies Championship.&nbsp;<\\/p>\\r\\n<p>Robbie\\u2019s extensive education and experience have prepared him to offer quality service and care. His goal-oriented approach and customized, research-based workout programs empower clients to be accountable, stay motivated, and have fun!<\\/p>\\r\\n<p>When Robbie is not at the gym, he enjoys riding his motorcycle, playing the guitar, and watching football (no surprise!).<\\/p>\",\"13\":[\"5\"],\"12\":\"Robbie Birdwell\",\"14\":\"\\u201cAs Iron Sharpens Iron, So One Man Sharpens Another.\\u201d\",\"15\":\"Proverbs 27:17\",\"11\":\"About\",\"10\":[\"4\"],\"9\":\"\",\"8\":\"View Workouts\",\"7\":\"It\\u2019s time to turn doubt into drive.\",\"22\":\"<p>Working out, eating healthy, and losing weight does not have to be a chore.&nbsp;<\\/p>\\r\\n<p>It should be an energizing, enjoyable, and empowering experience that you look forward to every day. Together, we will overcome your obstacles, push your boundaries and have a ton of fun, making your fitness dreams a reality.<\\/p>\",\"23\":\"\",\"21\":\"Services\",\"18\":\"\"}}', '2017-11-17 08:04:44', '2017-11-17 08:04:44', '6c422e15-f4b3-4cd3-b5fa-4a68f47e7e3a'),
 ('6', '8', '3', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"What my clients are saying...\",\"slug\":\"what-my-clients-are-saying\",\"postDate\":1512309367,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":\"Jennifer S.\",\"6\":\"\\u201cRobbie challenges me in ways better than any gym I have ever belonged to. He is friendly, professional and so much fun to be around. I tell whoever will listen\\u2014Robbie\\u2019s your guy.\\u201d\"}}', '2017-12-03 13:56:08', '2017-12-03 13:56:08', '1b722415-1c1c-4490-ba0a-e6b261e8545c'),
 ('7', '2', '1', '1', 'en_us', '5', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1510900517,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"<p>For Robbie Birdwell, fitness is more than a passion&mdash;it\\u2019s a lifestyle. He\\u2019s personally experienced the power of physical conditioning to provide mental, spiritual, and bodily healing.&nbsp;<\\/p>\\r\\n<p>Having a diverse background in health and fitness, Robbie specializes in injury prevention, rehabilitation, and functional training. His expertise in correcting mobility issues and faulty movement patterns has helped clients of all types, from injury-plagued couch potatoes to Division 1 college athletes.<\\/p>\\r\\n<p>As a certified athletic trainer (through the National Board of Certification for Athletic Training), Robbie earned his bachelor\\u2019s degree in athletic training and sports medicine from Baylor University. He went on to receive a master\\u2019s degree in kinesiology from the University of North Texas. He worked with several notable athletes throughout his collegiate career including track stars, Jeremy Wariner, Darold Williamson, and Stephen White as well as then up-and-coming NFL players, Robert Griffin III (RG3), Jason Smith, Lance Dunbar, and Zachary Orr.<\\/p>\\r\\n<p>Robbie also knows firsthand what it takes to prepare and compete. He played professional arena football in the Indoor Football League (IFL) for two years and competed as a bodybuilder within the physique division for the Better Bodies Championship.&nbsp;<\\/p>\\r\\n<p>Robbie\\u2019s extensive education and experience have prepared him to offer quality service and care. His goal-oriented approach and customized, research-based workout programs empower clients to be accountable, stay motivated, and have fun!<\\/p>\\r\\n<p>When Robbie is not at the gym, he enjoys riding his motorcycle, playing the guitar, and watching football (no surprise!).<\\/p>\",\"13\":[\"5\"],\"12\":\"Robbie Birdwell\",\"14\":\"\\u201cAs Iron Sharpens Iron, So One Man Sharpens Another.\\u201d\",\"15\":\"Proverbs 27:17\",\"11\":\"About\",\"10\":[\"4\"],\"9\":\"\",\"8\":\"View Workouts\",\"7\":\"It\\u2019s time to turn doubt into drive.\",\"22\":\"<p>Working out, eating healthy, and losing weight does not have to be a chore.&nbsp;<\\/p>\\r\\n<p>It should be an energizing, enjoyable, and empowering experience that you look forward to every day. Together, we will overcome your obstacles, push your boundaries and have a ton of fun, making your fitness dreams a reality.<\\/p>\",\"23\":\"\",\"21\":\"Services\",\"18\":[\"8\"],\"32\":\"What my clients are saying...\"}}', '2017-12-03 14:02:10', '2017-12-03 14:02:10', 'b8249024-88be-4aca-8d8e-ad6e57d320bd'),
 ('8', '9', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Nutrition Coaching\",\"slug\":\"nutrition-coaching\",\"postDate\":1512309774,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Education is key when it comes to proper nutrition. That\\u2019s why I offer a separate service devoted to meal planning. Your dietary restrictions and workout goals should work together. Learn specific techniques to make meal prepping easier. Discover how to enjoy \\u201ccheat days\\u201d and still reach your fitness goals. Meal prepping and delivery are available through our partner, Prepped and Ready Meal Prep.<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:02:54', '2017-12-03 14:02:54', 'b21e2416-99a1-41fa-960b-c23d448de93a'),
 ('9', '10', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"\\u200bPersonal training\",\"slug\":\"personal-training\",\"postDate\":1512309799,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Intimidated by large groups? My personal training program is a great option for those who desire one-on-one attention. Together, we\\u2019ll assess your current state and establish realistic goals by completing a fitness and nutrition assessment. Using this data, I\\u2019ll develop a customized, guided workout program and nutrition plan. (Meal prepping and delivery available upon request.)<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:03:19', '2017-12-03 14:03:19', '0bb39dac-5b27-4610-9b7a-e3e5fd5fdb42'),
 ('10', '11', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Small Group Training\",\"slug\":\"small-group-training\",\"postDate\":1512309828,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Thrive in small groups? Grab a group of 2-5 friends, relatives, or colleagues, and share the cost! We\\u2019ll use the fitness and nutrition assessment to create individual goals as well as to develop customized, guided workout programs and nutrition plans. You\\u2019ll still enjoy the benefit of personalized attention but in a slightly more social environment. (Meal prepping and delivery available upon request.)<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:03:48', '2017-12-03 14:03:48', 'beeaa5e7-a043-4bf3-b093-4de1ade37fcf'),
 ('11', '12', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"\\u200bonline training\",\"slug\":\"online-training\",\"postDate\":1512309847,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Adapt your fitness program to your lifestyle with online training. If you travel often for work or prefer the comfort of your own home, I provide a customized experience, suitable for any setting, via the app, Trainerize. View your workouts, track your meals, send me messages, and more&mdash;access everything you need on your mobile device or desktop. (Meal prepping and delivery available upon request.)<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:04:07', '2017-12-03 14:04:07', 'ac390986-1fe7-42d1-b718-359b4602bb90'),
 ('12', '13', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"\\u200bbridal boot camps\",\"slug\":\"bridal-boot-camps\",\"postDate\":1512309867,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Got the perfect dress, now need to fit into it? You\\u2019re not alone. Our bridal boot camps provide the perfect environment to whip your body into shape and de-stress at the same time. Bring your bridesmaids along&mdash;discounts are available for groups, so the more the merrier. Join now and get ready for the big day!<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:04:27', '2017-12-03 14:04:27', 'd046c7b1-41ee-44ce-9adc-55ebc18e78d0'),
 ('13', '14', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"\\u200bsport-specific strength training\",\"slug\":\"sport-specific-strength-training\",\"postDate\":1512309896,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Want to take your athletic ability to the next level? Want to train like the pros? This program is for the serious athlete who needs help with distinct skills in order to compete. Drawing on my background as an athlete and athletic trainer, I provide rigorous workouts tailored to your sport as well as insight on the best techniques to help you reach your goals.<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:04:56', '2017-12-03 14:04:56', '5b17b0c6-8c40-4566-a543-0cbef089d1ba'),
 ('14', '15', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"Workplace Ergonomics Consulting\",\"slug\":\"workplace-ergonomics-consulting\",\"postDate\":1512309921,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Optimize your work space! Are you sitting correctly? Is your monitor in the best position? I\\u2019ll observe your work environment as well as how you work, and get an inventory of current physical issues (ex. headaches, backaches, etc.). From there, I\\u2019ll provide research-based solutions to modify your work space and enhance your wellness. Gain insight on the best ways to stay highly productive and injury-free.<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:05:21', '2017-12-03 14:05:21', '45bb6d37-9ff6-4057-b1ec-3833097b8c56'),
 ('15', '16', '4', '1', 'en_us', '1', '', '{\"typeId\":null,\"authorId\":\"1\",\"title\":\"\\u200brestorative therapy\",\"slug\":\"restorative-therapy\",\"postDate\":1512309938,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Aches and pains? Come see me! My unique regimen of deep tissue massages and corrective exercises reduces the discomfort associated with many injuries. I employ the same level of care I used when working with both professional and division I athletes. Sign up for a free consultation, and we\\u2019ll discuss the best way to restore proper function to your body.<\\/p>\",\"20\":\"\"}}', '2017-12-03 14:05:38', '2017-12-03 14:05:38', '90708b23-ecb0-4b20-a4d3-53b555fea982'),
 ('16', '2', '1', '1', 'en_us', '6', '', '{\"typeId\":null,\"authorId\":null,\"title\":\"Homepage\",\"slug\":\"homepage\",\"postDate\":1510900517,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"16\":\"<p>For Robbie Birdwell, fitness is more than a passion&mdash;it\\u2019s a lifestyle. He\\u2019s personally experienced the power of physical conditioning to provide mental, spiritual, and bodily healing.&nbsp;<\\/p>\\r\\n<p>Having a diverse background in health and fitness, Robbie specializes in injury prevention, rehabilitation, and functional training. His expertise in correcting mobility issues and faulty movement patterns has helped clients of all types, from injury-plagued couch potatoes to Division 1 college athletes.<\\/p>\\r\\n<p>As a certified athletic trainer (through the National Board of Certification for Athletic Training), Robbie earned his bachelor\\u2019s degree in athletic training and sports medicine from Baylor University. He went on to receive a master\\u2019s degree in kinesiology from the University of North Texas. He worked with several notable athletes throughout his collegiate career including track stars, Jeremy Wariner, Darold Williamson, and Stephen White as well as then up-and-coming NFL players, Robert Griffin III (RG3), Jason Smith, Lance Dunbar, and Zachary Orr.<\\/p>\\r\\n<p>Robbie also knows firsthand what it takes to prepare and compete. He played professional arena football in the Indoor Football League (IFL) for two years and competed as a bodybuilder within the physique division for the Better Bodies Championship.&nbsp;<\\/p>\\r\\n<p>Robbie\\u2019s extensive education and experience have prepared him to offer quality service and care. His goal-oriented approach and customized, research-based workout programs empower clients to be accountable, stay motivated, and have fun!<\\/p>\\r\\n<p>When Robbie is not at the gym, he enjoys riding his motorcycle, playing the guitar, and watching football (no surprise!).<\\/p>\",\"13\":[\"5\"],\"12\":\"Robbie Birdwell\",\"14\":\"\\u201cAs Iron Sharpens Iron, So One Man Sharpens Another.\\u201d\",\"15\":\"Proverbs 27:17\",\"11\":\"About\",\"10\":[\"4\"],\"9\":\"\",\"8\":\"View Workouts\",\"7\":\"It\\u2019s time to turn doubt into drive.\",\"22\":\"<p>Working out, eating healthy, and losing weight does not have to be a chore.&nbsp;<\\/p>\\r\\n<p>It should be an energizing, enjoyable, and empowering experience that you look forward to every day. Together, we will overcome your obstacles, push your boundaries and have a ton of fun, making your fitness dreams a reality.<\\/p>\",\"23\":[\"9\",\"10\",\"11\",\"12\",\"13\",\"14\",\"15\",\"16\"],\"21\":\"Services\",\"18\":[\"8\"],\"32\":\"What my clients are saying...\"}}', '2017-12-03 14:29:48', '2017-12-03 14:29:48', '2f833163-c418-4f1a-a2b3-0da34f8d86bb'),
