 ('2', 'field', '8', 'en_us', ' view workouts '),
 ('2', 'field', '7', 'en_us', ' it s time to turn doubt into drive '),
 ('2', 'field', '16', 'en_us', ' for robbie birdwell fitness is more than a passion it s a lifestyle he s personally experienced the power of physical conditioning to provide mental spiritual and bodily healing having a diverse background in health and fitness robbie specializes in injury prevention rehabilitation and functional training his expertise in correcting mobility issues and faulty movement patterns has helped clients of all types from injury plagued couch potatoes to division 1 college athletes as a certified athletic trainer through the national board of certification for athletic training robbie earned his bachelor s degree in athletic training and sports medicine from baylor university he went on to receive a master s degree in kinesiology from the university of north texas he worked with several notable athletes throughout his collegiate career including track stars jeremy wariner darold williamson and stephen white as well as then up and coming nfl players robert griffin iii rg3 jason smith lance dunbar and zachary orr robbie also knows firsthand what it takes to prepare and compete he played professional arena football in the indoor football league ifl for two years and competed as a bodybuilder within the physique division for the better bodies championship robbie s extensive education and experience have prepared him to offer quality service and care his goal oriented approach and customized research based workout programs empower clients to be accountable stay motivated and have fun when robbie is not at the gym he enjoys riding his motorcycle playing the guitar and watching football no surprise '),
 ('2', 'field', '13', 'en_us', ' robbie circle '),
 ('2', 'field', '12', 'en_us', ' robbie birdwell '),
