 ('8', 'field', '6', 'en_us', ' robbie challenges me in ways better than any gym i have ever belonged to he is friendly professional and so much fun to be around i tell whoever will listen robbie s your guy '),
 ('8', 'field', '17', 'en_us', ' jennifer s '),
