 ('8', 'title', '0', 'en_us', ' what my clients are saying '),
 ('2', 'field', '32', 'en_us', ' what my clients are saying '),
 ('9', 'field', '1', 'en_us', ' education is key when it comes to proper nutrition that s why i offer a separate service devoted to meal planning your dietary restrictions and workout goals should work together learn specific techniques to make meal prepping easier discover how to enjoy cheat days and still reach your fitness goals meal prepping and delivery are available through our partner prepped and ready meal prep '),
