 ('9', 'title', '0', 'en_us', ' nutrition coaching '),
 ('10', 'field', '1', 'en_us', ' intimidated by large groups my personal training program is a great option for those who desire one on one attention together we ll assess your current state and establish realistic goals by completing a fitness and nutrition assessment using this data i ll develop a customized guided workout program and nutrition plan meal prepping and delivery available upon request '),
