 ('11', 'field', '1', 'en_us', ' thrive in small groups grab a group of 2 5 friends relatives or colleagues and share the cost we ll use the fitness and nutrition assessment to create individual goals as well as to develop customized guided workout programs and nutrition plans you ll still enjoy the benefit of personalized attention but in a slightly more social environment meal prepping and delivery available upon request '),
